import React from "react";

export default class Filter extends React.Component {
  render() {
    return (
      <tr>
        <td>{this.props.task}</td>
        <td>
          <button>Delete</button>
        </td>
        <td>
          <button>Active</button>
        </td>
        <td>
          <button>Completed</button>
        </td>
      </tr>
    );
  }
}
